import React,{useContext} from 'react'
import { useEffect } from 'react'
import ProductContext from '../contexts/productContext/productContext'
const home = () => {
  const productContext = useContext(ProductContext)
  console.log(productContext.ProductStoreContext.productsWithCount(5))
  useEffect(async()=>{
      const f = await productContext.ProductStoreContext.productsWithCount(5);
      console.log(f)
  },[])
  return (
    <div>home</div>
  )
}

export default home
